import React from 'react';
import { Card, Icon, Image, Header } from 'semantic-ui-react'
import '../App.css';

import Anuska from '../static/Anuska.jpeg';


const OfficersCard = (props) => {
	const imgSrc = props.img
	const link = props.link;
	const name = props.name;
	const title = props.title;
	const joinDate = props.date;
	const description = props.description;

	return (
		<Card>
		    <Image src={Anuska} wrapped ui={false} />
		    <Card.Content>
		      <Card.Header as ='h2'>{name}</Card.Header>
		      <Card.Meta>
		      	<Card.Header><Header>{title}</Header></Card.Header>
		        <span className='date'>Joined in {joinDate}</span>
		      </Card.Meta>
		      <Card.Description>
		       {description}
		      </Card.Description>
		    </Card.Content>
		    <Card.Content extra>
		        <a href = ''><Icon name='facebook'  centered/></a>
		        <a href = ''><Icon name='twitter' /></a>
		        <a href = ''><Icon name='instagram' /></a>
		        <a href = ''><Icon name='mail' /></a>
		    </Card.Content>
  		</Card>
 )};

class Officers extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      activeContainer: 'Home'
    };
  };

  render() {
    return(
        <OfficersCard
        	name = {'Anuska'}
        	title = 'Vice President'
        	img = {Anuska}
        	description = 'Everyone Calls Her Musa'
        	date = {2019}


        />
  )};
};

export default Officers;
